import React, { useState, useEffect } from 'react'
import axios from 'axios'

// const HomePage = () => {
//     return (
//         <h1>Spaceagram</h1>

//     )
// }

function HomePage() {
    const [posts, setPosts] = useState([])

    useEffect(() => {
        // rpf2PXcZhgOIA7Tjek38tFq5HDa7a5dsUgDiuVo1
        axios
        .get('https://api.nasa.gov/mars-photos/api/v1/rovers/curiosity/photos?sol=1000&api_key=DEMO_KEY')

        .then( res => {
            console.log(res)
            setPosts(res.data)
        })
        .catch( err => {
            console.log(err)
        })
    })
    return (
        <div>
            <h1>Spaceagram</h1>
            <ul>
                {
                    posts.map(post => (<li key={post.id}> 5 </li>
                    ))
                }
            </ul>
        </div>
    )
}

export default HomePage
